text:
all allegations need to be taken seriously, not covered up or have excuses made for them. the accuser has the same presumption of innocence as the accused, but too often we put the victim on trial first, in the court of public opinion. what i've seen in the last few weeks, in regards to the kavanaugh hearings, is people presuming innocence with no need to further investigate. "i think he's innocent, so looking any further is a waste of time", i've even heard people saying she is the one who should be being investigated. 
#metoo #victimblaming

i'm done dealing with people who can't think for themselves, or parrot propaganda and trite bullshit. if you can't make an actual intelligent point, or are here to troll, your comments will be deleted. and if it happens repeatedly, you will be blocked. this is my page and it will be run as i see fit, i'm not here to coddle your delusions ✌🏼
