text:
if i have to speak of monsters, 
i will tell you about my uncle. how he lurked around in the shadows. how he waited until i was asleep. how i was too afraid to move. how my breath caught on words i did not know how to say.

if i have to speak of horror, 
i will tell you about my parents. how they found the pictures. how i was forced to see him anyway. how i had to be polite. how my throat choked on words i was not allowed to say.

if i have to speak of phantoms, 
i would tell you about my first love. how his smile often vanished from his face. how his words left more bruises than his hands did. how parts of his body disappeared when we were alone. how my lips sobbed the word he must not have heard me say.

if i have to speak of skeletons, 
i would tell you all about my body. how my flesh is a memory of betrayal. how the cavities house the bugs that have crawled in and haven't left. how my bones snap under the weight of yesterday. how i’m trying to scream these words but my tongue has been ripped out.

and if i have to speak of fear
i will tell you all about having a daughter
and living in a haunted house
- a.h_blackstone

